import React, { useState } from "react";

interface CellProp {
  buffer: string;
  isSelected: boolean;
  handleOnClick(): void;
}

export default function EditableCell({
  buffer,
  isSelected,
  handleOnClick,
}: CellProp) {
  const [selected, setSelected] = useState(false);

  if (isSelected) {
    return (
      <div
        className="w-24 h-7 border-2 bg-pink-200 border-solid border-pink-800 text-left"
        onClick={handleOnClick}
      >
        {buffer}
      </div>
    );
  } else {
    return (
      <div
        className="w-24 h-7 border-2 bg-gray-200 border-solid border-gray-500 text-left"
        onClick={handleOnClick}
      >
        {buffer}
      </div>
    );
  }
}
